import React from 'react';
import { Document, Page } from 'react-pdf';

window['pdfjs-dist/build/pdf.worker'] = '/path/to/pdf.worker.min.js';

const ArticleContent = ({ onClose }) => (
  <div>
    <h1>Article Title</h1>
    <Document file="./assets/documents/Article.pdf">
      <Page pageNumber={1} />
    </Document>
    <button onClick={onClose}>Close Article</button>
  </div>
);

export default ArticleContent;
